import React from "react";
import { Link, useNavigate } from "react-router-dom";

const Navbar = () => {
  const isAdmin = localStorage.getItem("isAdmin") === "true";
  const navigate = useNavigate();

  const handleLogout = () => {
    localStorage.removeItem("isAdmin");
    navigate("/admin-login");
  };

  return (
    <nav className="bg-blue-600 text-white px-4 py-3 flex justify-between items-center">
      <h1 className="text-xl font-semibold">JantaVoice</h1>
      <div className="space-x-4 flex items-center">
        <Link to="/">Home</Link>
        <Link to="/complaint">ComplaintForm</Link>
        <Link to="/voice">VoiceComplaint</Link>
        <Link to="/track">TrackStatus</Link>
        <Link to="/analytics">Analytics</Link>

        {/* ✅ Show dashboard only if admin */}
        {isAdmin && <Link to="/admin">AdminDashboard</Link>}

        {/* ✅ Logout button for admin */}
        {isAdmin && (
          <button
            onClick={handleLogout}
            className="bg-red-500 text-white px-3 py-1 rounded text-sm"
          >
            Logout
          </button>
        )}
      </div>
    </nav>
  );
};

export default Navbar;
